script: |
  super -f text -I q12134.spq | sort > q12134.out

inputs:
  - name: q12134.spq
    data: |
      SELECT DISTINCT - - COUNT ( * ) / - COUNT ( * ) AS col1, - COUNT ( * ) AS col0 FROM tab0 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1;
  - name: tab0
  - name: tab2

outputs:
  - name: q12134.out
    data: |
      -1	-9
